import React from 'react';
import MaterialTable from 'material-table'
import { Grid, IconButton, makeStyles } from '@material-ui/core';
import AdminLinks from '../management/AdminLinks';
import { ToggleButton } from 'react-bootstrap';
import VisibilityIcon from '@material-ui/icons/Visibility';
import { VisibilityOutlined } from '@material-ui/icons';

const useStyles=makeStyles(()=>({
  list:{
    margin:"80px"
  }
}))
export default function Quizlist() {
  const classes= useStyles()
  return (
    <>
    <AdminLinks/>
     <Grid container justify="center" className={classes.list}>
       <Grid item xs={11} sm={6} md={6} lg={10}>

       <MaterialTable
      title="Basic Sorting Preview"
      columns={[
        { title: 'Id', field: 'id' },
        { title: 'Title', field: 'title' },
        { title: 'Results', field: 'slug' },
        {
          title: 'Language',field: 'language',
        },
        { title: 'Active', field: 'active' },
        { title: 'View', field: 'View' },
        { title: 'Results', field: 'results' },
        { title: 'Edit', field: 'edit' },
        { title: 'Edit', field: 'results' },
        { title: 'Results', field: 'results' }
      ]}
      data={[
        { id: '567', title: 'Baran', slug:"mirzapur-dialouge", language:"en",active:<ToggleButton/>,view:<IconButton><VisibilityOutlined/> </IconButton>},
      ]}        
      options={{
      sorting: true
    }}
    />
       </Grid>
    </Grid>
    </>

  )
}
